import List from './List.jsx'

function App(){

    const fruits = [{id:1, name:"apple", calories: 95},
        {id:2, name:"orange", calories: 45},
        {id:3, name:"banana", calories: 105}];
    
    const vegetables = [{id:4, name:"Potatoes", calories: 32},
                        {id:5, name:"Tomatoes", calories: 87},
                        {id:6, name:"onion", calories: 143}];

    const Cricketers = [{id:7}]


    return( <>
                <List items={fruits} category="Fruits"/>
                <List items={vegetables} category="Vegerables"/>
            </>);
}

export default App
